import ButtonGroup from "react-bootstrap/ButtonGroup";
import Dropdown from "react-bootstrap/Dropdown";
import { Form } from "react-bootstrap";
import { useState } from "react";

function DropDownSubject({ props }) {
  const [subject, setSubject] = useState(props);
  return (
    <Dropdown as={ButtonGroup}>
      <Form.Control type="text" placeholder={props} disabled />

      <Dropdown.Toggle split variant="dark" id="dropdown-split-basic" />

      <Dropdown.Menu>
        <Dropdown.Item
          onClick={() => setSubject("Introduction to Computer Science")}
        >
          Introduction to Computer Science
        </Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("Data Structures and Algorithms")}>Data Structures and Algorithms</Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("Database Systems")}>Database Systems</Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("Operating Systems")}>Operating Systems</Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("Computer Networks")}>Computer Networks</Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("Web Development")}>Web Development</Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("")}></Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("")}></Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("")}></Dropdown.Item>
        <Dropdown.Item onClick={() => setSubject("")}></Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
}

export default DropDownSubject;
